import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
     <h1> React </h1>
     <ul>
       <li> HTML</li>
       <li> CSS </li>
       <li> JS </li>
     </ul>
    </div>
  );
}

export default App;
